import { getTeamBelongToThisAlliance } from "../helpers/Api/helperApis";
import List from "@mui/material/List";
import ListItem from "@mui/material/ListItem";
import ListItemText from "@mui/material/ListItemText";
import ListItemAvatar from "@mui/material/ListItemAvatar";
import Avatar from "@mui/material/Avatar";
import alliances from "../reducers/alliances";
import { styled } from "@mui/material/styles";
import Box from "@mui/material/Box";
import ListItemIcon from "@mui/material/ListItemIcon";
import IconButton from "@mui/material/IconButton";
import FormGroup from "@mui/material/FormGroup";
import FormControlLabel from "@mui/material/FormControlLabel";
import Checkbox from "@mui/material/Checkbox";
import Grid from "@mui/material/Grid";
import DeleteIcon from "@mui/icons-material/Delete";
import FolderIcon from "@mui/icons-material/Folder";

function Alliance(props) {
  const [{ isOver }, drop] = useDrop(() => ({
    accept: "team",
    drop: (item) => {
      addTeamToAlliance(item.team, props.alliance);
    },
  }));
  let teams = JSON.parse(localStorage.getItem(`${props.alliance.id}`)) || [];
  console.log(teams, "teamssssssss");
  const Demo = styled("div")(({ theme }) => ({
    backgroundColor: theme.palette.background.paper,
  }));
  useEffect(async () => {}, []);
  return (
    // <List className="alliance" ref={drop}>
    //   {teams.map((team) => {
    //     return <div> {team.Name}</div>;
    //   })}
    // </List>
    <Demo>
      <List dense={dense}>
        {generate(
          <ListItem
            secondaryAction={
              <IconButton edge="end" aria-label="delete">
                <DeleteIcon />
              </IconButton>
            }
          >
            <ListItemAvatar>
              <Avatar>
                <FolderIcon />
              </Avatar>
            </ListItemAvatar>
            <ListItemText
              primary="Single-line item"
              secondary={secondary ? "Secondary text" : null}
            />
          </ListItem>
        )}
      </List>
    </Demo>
  );
}
export default Alliance;
